import React from 'react';
import Link from 'next/link';


const navLink = [
    {
        title: 'HOME',
        path:'/'
    },
    {
        title: 'PRODUCTS',
        path:'/products'
    },
    {
        title: 'BRANDS',
        path:'/brands'
    },
    {
        title: 'SIGNIN',
        path:'/sign-in'
    },
    {
        title: 'SIGNUP',
        path:'/sign-up'
    }
]

function Navigation() {
    return(
        <nav className="site-navigation">
            <span>Cubiz Store</span>
            <ul>
                { navLink.map((link, index) => (
                     <li key={index}>
                        <Link> {link.title}</Link>
                     </li>
                ))
                }
            </ul>
        </nav>
    )
}

export default Navigation;
